Det er for svært at fin-kontrollere permissions. tilføj i stedet for: "arn:aws:dynamodb:eu-west-1:566946868324:table/ai-counting-dev-*" til: 
{
            "Action": [
                "dynamodb:*"
            ],
            "Resource": [
                "arn:aws:dynamodb:eu-west-1:566946868324:table/travelapp-*-dev-*"
            ],
            "Effect": "Allow"
        }
